function bubbleSort(list){
    var b;
    for (var j=0;j<list.length;j++){
        for (var i=0;i<list.length-j;i++){
            if (list[i]>list[i+1]){
                b=list[i+1];
                list[i+1]=list[i];
                list[i]=b;
            }
        }
    }
    return list;
}
function sort(a,b,c){
    var output=bubbleSort([a,b,c]);
    return output[0]+" "+output[1]+" "+output[2];
}
console.log(sort(4,-9,11));
